from pybricks.hubs import PrimeHub
from pybricks.parameters import Axis, Button, Direction, Port, Stop
from pybricks.pupdevices import ColorSensor, Motor
from pybricks.robotics import DriveBase
from pybricks.tools import StopWatch, multitask, run_task, wait

from pi_turn import p_turn_incremental_async, p_turn_incremental_sync, reset_current_heading

# Set up all devices.
prime_hub = PrimeHub(top_side=Axis.Z, front_side=Axis.X)
right_light = ColorSensor(Port.A)
left_light = ColorSensor(Port.B)
timer = StopWatch()
left = Motor(Port.F, Direction.COUNTERCLOCKWISE)
right = Motor(Port.E, Direction.CLOCKWISE)
drive_base = DriveBase(left, right, 62.4, 110)
left_attachment = Motor(Port.D, Direction.CLOCKWISE)
right_attachment = Motor(Port.C, Direction.COUNTERCLOCKWISE)

# Initialize variables.
run_tracker = 1

async def subtask():
    while not Button.RIGHT in prime_hub.buttons.pressed():
        await wait(0)
    await reset_current_heading()
    prime_hub.imu.reset_heading(0)
    await execute_run()
    await increase_tracker()
    await wait(220)

async def subtask2():
    while not Button.LEFT in prime_hub.buttons.pressed():
        await wait(0)
    await increase_tracker()
    await wait(220)

async def subtask3():
    while not Button.BLUETOOTH in prime_hub.buttons.pressed():
        await wait(0)
    await what_just_happened()

async def execute_run():
    await wait(0)
    if run_tracker == 1:
        await gardener_run()
    elif run_tracker == 2:
        await mma_run()
    elif run_tracker == 3:
        await item_dump()
    elif run_tracker == 4:
        await sandstorm_run()
    elif run_tracker == 5:
        await sprinky_run()
    elif run_tracker == 6:
        await bumblebee_run()
    else:
        await sleigh_ride_run()
    drive_base.stop()

async def p_turn_increment_bee(angle):
    await wait(0)
    await p_turn_incremental_async(angle, left, right, prime_hub, 0)

async def what_just_happened():
    await wait(0)
    await right_attachment.run_angle(1200, 210)
    await right_attachment.run_angle(1200, -210)

async def p_turn_increment_sand(angle):
    await wait(0)
    await p_turn_incremental_async(angle, left, right, prime_hub, 15)

async def p_turn_increment_mma(angle):
    await wait(0)
    await p_turn_incremental_async(angle, left, right, prime_hub, 0)

async def p_turn_increment_sprinky(angle):
    await wait(0)
    await p_turn_incremental_async(angle, left, right, prime_hub, 0)

async def increase_tracker():
    global run_tracker
    await wait(0)
    run_tracker = run_tracker + 1
    if run_tracker == 8:
        run_tracker = 1

async def p_turn_increment_garden(angle):
    await wait(0)
    await p_turn_incremental_async(angle, left, right, prime_hub, 15)

async def item_dump():
    await wait(0)
    drive_base.settings(straight_speed=800)
    await drive_base.straight(-450, then=Stop.COAST)
    await drive_base.straight(450, then=Stop.COAST)
    drive_base.stop()

async def subtask4():
    left.dc(50)
    while not prime_hub.imu.heading() >= 135:
        await wait(0)
    left.hold()
    await drive_base.straight(-100)
    await drive_base.straight(75)

async def bumblebee_run():
    await wait(0)
    prime_hub.imu.reset_heading(0)
    drive_base.use_gyro(True)
    drive_base.settings(straight_speed=400)
    drive_base.settings(straight_acceleration=750)
    await drive_base.straight(680)
    await p_turn_increment_bee(45)
    while not await left_light.reflection() < 20:
        await wait(0)
        drive_base.drive(100, 0)
    drive_base.straight(0)
    await left_attachment.run_angle(500, 100)
    drive_base.settings(straight_speed=50)
    await drive_base.straight(57)
    await right_attachment.run_angle(200, 210)
    await wait(250)
    await right_attachment.run_angle(150, -210)
    drive_base.settings(straight_speed=400)
    await drive_base.straight(-150)
    drive_base.settings(straight_speed=100)
    await multitask(
        subtask4(),
        left_attachment.run_angle(500, -100),
    )
    await p_turn_increment_bee(60)
    print(prime_hub.imu.heading())
    drive_base.settings(straight_speed=200)
    await drive_base.straight(-400)
    await p_turn_increment_bee(30)
    timer.reset()
    left.dc(40)
    right.dc(40)
    while not timer.time() >= 2500:
        await wait(0)
    right.hold()
    left.hold()
    await drive_base.straight(-100)
    await p_turn_incremental_async(-20, left, right, prime_hub, 30)
    drive_base.settings(straight_speed=800)
    await drive_base.straight(300)
    await p_turn_incremental_async(50, left, right, prime_hub, 30)
    await drive_base.straight(670)
    drive_base.stop()

async def p_turn_increment_sleigh(angle):
    await wait(0)
    await p_turn_incremental_async(angle, left, right, prime_hub, 27)

async def subtask5():
    drive_base.settings(straight_speed=800)
    await drive_base.straight(670)

async def subtask6():
    await wait(500)
    await left_attachment.run_angle(5000, 1000)

async def mma_run():
    await wait(0)
    prime_hub.imu.reset_heading(0)
    drive_base.settings(straight_speed=300)
    drive_base.settings(straight_acceleration=750)
    await drive_base.straight(720)
    await p_turn_increment_mma(90)
    await drive_base.straight(365)
    await p_turn_increment_mma(-90)
    drive_base.settings(straight_speed=80)
    await drive_base.straight(-75)
    await right_attachment.run_angle(200, 250)
    await drive_base.straight(40)
    await multitask(
        right_attachment.run_angle(1000, -300),
        wait(2500),
        race=True,
    )
    await wait(100)
    drive_base.settings(straight_speed=150)
    await drive_base.straight(195)
    await left_attachment.run_angle(1000, -1200)
    await wait(100)
    await left_attachment.run_angle(1000, 1200)
    drive_base.settings(straight_speed=200)
    await drive_base.straight(-170)
    await drive_base.straight(70)
    await p_turn_increment_mma(-84)
    drive_base.settings(straight_speed=400)
    await drive_base.straight(350)
    await p_turn_increment_mma(-80)
    await left_attachment.run_angle(1000, -1000)
    await multitask(
        subtask5(),
        subtask6(),
    )

async def sleigh_ride_run():
    await wait(0)
    drive_base.settings(straight_speed=500)
    await drive_base.straight(250)
    await p_turn_increment_sleigh(-30)
    await drive_base.straight(500)
    await p_turn_increment_sleigh(-50)
    await drive_base.straight(285)
    await p_turn_increment_sleigh(30)
    await drive_base.straight(-50)

async def gardener_run():
    await wait(0)
    drive_base.settings(straight_speed=350)
    await drive_base.straight(520)
    await p_turn_increment_garden(30)
    await drive_base.straight(145)
    await p_turn_increment_garden(-75)
    await multitask(
        drive_base.straight(240),
        wait(2500),
        race=True,
    )
    await drive_base.straight(-60)
    await left_attachment.run_angle(500, -300)
    await drive_base.straight(40)
    await left_attachment.run_angle(500, 300)
    await drive_base.straight(-155)
    await p_turn_increment_garden(45)
    await drive_base.straight(-125)
    await p_turn_increment_garden(90)
    await multitask(
        drive_base.straight(-130),
        wait(2000),
        race=True,
    )
    await multitask(
        right_attachment.run_angle(1500, 810),
        wait(4000),
        race=True,
    )
    await right_attachment.run_angle(1500, -810)
    await drive_base.straight(90)
    await p_turn_increment_garden(-60)
    drive_base.settings(straight_speed=520)
    await drive_base.straight(-520)
    drive_base.stop()

async def subtask7():
    await drive_base.straight(-115)
    await p_turn_increment_sprinky(-116.7)
    drive_base.settings(straight_speed=600)
    await drive_base.straight(-260)
    await drive_base.straight(160)
    await drive_base.arc(-367, angle=-120, then=Stop.COAST)

async def sprinky_run():
    await wait(0)
    drive_base.use_gyro(True)
    drive_base.settings(straight_speed=350)
    drive_base.settings(straight_acceleration=2000)
    await drive_base.straight(230)
    await p_turn_increment_sprinky(-90)
    await drive_base.straight(535)
    await p_turn_increment_sprinky(90)
    await drive_base.straight(100)
    await right_attachment.run_angle(-200, 90)
    await wait(500)
    await multitask(
        right_attachment.run_angle(500, 90),
        subtask7(),
    )
    right_attachment.stop()

async def sandstorm_run():
    await wait(0)
    prime_hub.imu.reset_heading(0)
    drive_base.use_gyro(True)
    drive_base.settings(straight_speed=500)
    await multitask(
        drive_base.straight(-365),
        right_attachment.run_angle(1000, 185),
    )
    await wait(25)
    drive_base.settings(straight_speed=250)
    await drive_base.straight(160)
    await p_turn_increment_sand(-49.5)
    await drive_base.straight(-196)
    await p_turn_increment_sand(45)
    await drive_base.straight(-130)
    await left_attachment.run_angle(360, 180)
    await wait(25)
    await left_attachment.run_angle(1000, -180)
    await drive_base.straight(100)
    await p_turn_increment_sand(-15)
    await drive_base.straight(-300)
    await p_turn_increment_sand(15)
    while not await right_light.reflection() < 20:
        await wait(0)
        drive_base.drive(-250, 0)
    await p_turn_increment_sand(45)
    right_attachment.reset_angle(0)
    await right_attachment.run_angle(1000, -185)
    await drive_base.straight(210)
    await p_turn_increment_sand(15)
    await right_attachment.run_angle(5000, 187)
    await multitask(
        p_turn_increment_sand(21),
        wait(1000),
        race=True,
    )
    await drive_base.straight(-70)
    await p_turn_increment_sand(60)
    await right_attachment.run_angle(670, 250)
    await drive_base.straight(235)
    await p_turn_increment_sand(-15)
    await drive_base.straight(80)
    await wait(25)
    await drive_base.straight(-300)
    await p_turn_increment_sand(65)
    drive_base.settings(straight_speed=1000)
    await drive_base.straight(980)

async def main():
    global run_tracker
    run_tracker = 1
    while True:
        await wait(0)
        prime_hub.display.number(run_tracker)
        await multitask(
            subtask(),
            subtask2(),
            subtask3(),
            race=True,
        )


run_task(main())